import logo from './logo.svg';
import './App.css';
import Hello from './components/Greet';
import { Bye } from './components/Greet';
import Welcome from './components/Welcome';
import FunctionClick from './components/FunctionClick';
import Login from './components/Login';
import Dashboard from './components/Dashboard';

import { Component } from 'react';

class App extends Component{
  constructor(){
    super()
    this.state={password:'',email:''}
  }

  handlecallback=(childValues)=>{
    this.setState({
      email:childValues.email,
      password:childValues.password
    })
    console.log("CALLED")
  }
  render(){
    this.page=this.state.email==''?<Login parentcallback = {this.handlecallback} />:<Dashboard email={this.state.email} password={this.state.password}/>
    return (
      <div className="App">
        {this.page}
      </div>
    );
  }
}

export default App;
